# ID: DNA
# Q: Counting DNA nucleotides
# Given: A DNA string s of length at most 1000 nt.
# Return: Four integers (separated by spaces) counting the respective number of times that the symbols 'A', 'C', 'G', and 'T' occur in s.

def count_nucleotides(s):
    # O(n) = O(n) 
    print(f'{s.count("A")} {s.count("C")} {s.count("G")} {s.count("T")}')

test1 = "AGCTTTTCATTCTGACTGCAACGGGCAATATGTCTCTGTGTGGATTAAAAAAAGAGTGTCTGATAGCAGC"
count_nucleotides(test1)

test2 = ""
count_nucleotides(test2)

test3 = ""
count_nucleotides(test3)


